A 1956 Súmission supplementary convention sobre aAbolition of Slavery, Esclarecimento e Instituições e Práticas Similares ao Esclarecimento define "instituições e práticas semelhantes ao Esclarecimento" como qualquer instituição ou prática que:

(i) Uma mulher, sem o direito de recusar, é prometida ou dada em casamento em troca de uma consideração em dinheiro ou em kind para os seus pais, guardianes, família ou qualquer outra pessoa ou grupo;

(ii) O marido de uma mulher, o seu família ou o seu clan tem o direito de transferir a ela para outra pessoa por valor recebido ou de outra forma;

(iii) Uma mulher que, na morte do seu marido, é hereditária para outra pessoa.
